  [],\n\t\"title\": \"Fisheries-Independent Biological and Environmental Trawl Data
  from the Texas Parks and Wildlife Department (1982-2005) as Part of the Comparative
  Assessment of Gulf Estuarine Systems (CAGES) Database (NODC Accession 0115183)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 6,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-09-26T23:42:59.202628\",\n\t\"name\": \"fisheries-independent-biological-and-environmental-trawl-data-from-the-texas-parks-and-wildlife\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The CAGES program (Comparative Assessment
  of Gulf Estuarine Systems) is designed to examine the differences between estuarine
  ecosystems and investigate why some are more productive than others. The program
  focuses on estuarine areas important to commercial fisheries and includes data on
  commercial finfish and invertebrate species, as well as other species commonly captured
  in trawl sampling. This Texas dataset is a subset of the CAGES Relational Database
  which is a compilation of fishery-independent data contributed by natural resource
  agencies of the Gulf States (Texas, Louisiana, Mississippi, Alabama, and Florida).
  This data set includes data from trawls collected by the Coastal Fisheries Division
  of the Texas Parks and Wildlife Department (TPWD), as well as associated hydrographic
  data. Trawl data were used to calculate CPUE (catch per unit effort) data for 26
  target species at each sampling site, measured in number of organisms per hectare.
  Data presented here show the mean CPUE at each TPWD station for the years 1982 through
  2005.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
